window.bookSummaryJSON = "<p>Magic doesn’t lie. Witches do.</p> <p>Our Coven Leader is dead...and they think I killed him. I didn’t. I would never have hurt him. I tried everything I could to save him.</p> <p>But it’s their word against mine.</p> <p>And with his blood staining my hands and caked in my hair, I don’t know how I’m going to get them to believe me....</p> <p>Because the truth is far more unsettling...those shadow creatures knew exactly where and when to ambush us. Someone set us up to be slaughtered...and it wasn’t me.</p> <p>The scariest part is...that Ouija Board tried to warn me....</p>"; 
